textOriginal:
***Para ganhar a eleição 2022***
*Retirar o sistema de biometria das sessões;
*Escolher mesário de forma aleatória;
*Incentivar os amigos e familiares à votar;
*Realçar a influência das pesquisas no debate
*Apresentar propostas fortes e mostrar que a proposta do Lula de 150 reais por filho é loucura;
*Ter controle emocional e não falar abobrinha.

Defendei o pobre e o órfão;
fazei justiça ao aflito e necessitado.
Salmo 82:3
